from typing import List

class SolutionA:
    def majorityElement(self, nums: list[int]) -> int:
        elements = {}
        majority_value = 0
        majority_element = 0
        for i in nums:
            if elements.get(i, 0) == 0:
                elements[i] = 1
            else: 
                elements[i] = elements[i] + 1 
            if elements[i] > majority_value:
                majority_value = elements[i]
                majority_element = i
        return majority_element

class SolutionB:
    def majorityElement(self, nums: list[int]) -> int:
        count = 0
        majority_value = 0
        elements = {}
        for i in nums:
            if elements.get(i, 0) == 0: 
                value = nums.count(i)
                if count < value:
                    count = value
                    majority_value = i
            elements[i] = 1
        return majority_value
    
class SolutionC:
    def majorityElement(self, nums: list[int]) -> int:
        elements = {}
        for i in nums:
            if elements.get(i, 0) == 0:
                elements[i] = 1
            else: 
                elements[i] = elements[i] + 1
        majority_element = 0
        count = 0
        for k, v  in elements.items():
            if count < v:
                count = v
                majority_element = k
        return majority_element
    
